import React from "react";

function App() {
  const projects = [
    { name: "places2be", description: "A social media app for NYU students, by NYU students. Share and review local study, food, and leisure spots.", link: "https://www.youtube.com/watch?v=xZwKXef8rUE" },
    { name: "Farmers Retreat Website", description: "The website for a land-holding corporation in North-Central Pennsylvania. Members can pay dues, upload documents, and chat with other members.", link: "#" },
    { name: "chasecvitale.com", description: "This website!", link: "#" },
  ];

  return (
    <div style={{ fontFamily: "Roboto, sans-serif", margin: "20px", backgroundColor: "white" }}>
      <header style={{ textAlign: "left",  }}>
        <b>hey, my name is </b>
        <h1>Chase C. Vitale</h1>
      </header>
      <main>
        <b>i'm a sophomore at nyu studying math and computer science. so far, i have experience with Python, Java, and JavaScript. additionally, i have worked with react and react native to create some really cool projects, check them out below!</b>
        <h2>Portfolio:</h2>
        <b>Check out some of my cool projects!</b>
        <ul style={{ listStyleType: "none", padding: 0 }}>
          {projects.map((project, index) => (
            <li
              key={index}
              style={{
                marginBottom: "20px",
                padding: "10px",
                border: "1px solid #ccc",
                borderRadius: "8px",
                backgroundColor: "#b9b9b9",
                borderColor: "black",
              }}
            >
              <h3>{project.name}</h3>
              <p>{project.description}</p>
              <a
                href={project.link}
                target="_blank"
                rel="noopener noreferrer"
                style={{ color: "blue", textDecoration: "none" }}
              >
                Project Page
              </a>
            </li>
          ))}
        </ul>
      </main>
    </div>
  );
}

export default App;
